_DESCRIPTION_:
Аргус-Спектр Аврора-ДИ исп.2 (ИП 212-82/2) - дымовой адресно-аналоговый для работы с БСЛ240-И. Предназначен для обнаружения дыма в охраняемом помещении и передачи сигнала о пожаре на приёмно-контрольные устройства (ПКУ) посредством беспроводного интерфейса. Извещатель контролирует состояние обоих батарей, и, в случае разряда любой из них, индицирует его с помощью встроенного светодиодного индикатора, а также передает информацию об этом событии на ПКУ, за которым он закреплен.

В качестве ПКУ могут быть использованы:РРОП–И;
РРОП–М2, РРОП–М исп.У;
РРОП2;
АСБ–РС (совместно с ППКП "Радуга–2А" или "Радуга–4А");
ПКР–GSM (Комплект квартирный Sagittarius).

Особенности:двунаправленная радиосвязь;
возможность передачи аналоговой величины;
программирование уровня чувствительности;
высокая надежность и чувствительность;
гибкая настройка системы на объекте;
удобство установки, обслуживания и монтажа;
передовые технологии;
два элемента питания (основной и резервный).

Основные характеристики:Параметры оповещателя программируются через ПКУ по радиоканалу;
ПКУ, за которым закреплен оповещатель, осуществляет автоматическое управление мощностью излучения оповещателя, в зависимости от качества связи;
Оповещатель осуществляет автоматическую подстройку частоты приема и излучения, приводя ее в соответствие частоте ПКУ, за которым он закреплен.

Аргус-Спектр Аврора-ТИ (ИП 101-80/1-А1) -  извещатель пожарный тепловой максимально-дифференциальный адресно-аналоговый. Предназначен для обнаружения дыма в охраняемом помещении и передачи сигнала о пожаре на приёмно-контрольные устройства (ПКУ) посредством беспроводного интерфейса. 

В качестве ПКУ могут быть использованы:РРОП–И;
РРОП–М2, РРОП–М исп.У;
РРОП2;
АСБ–РС (совместно с ППКП "Радуга–2А" или "Радуга–4А");
ПКР–GSM (Комплект квартирный Sagittarius).

Особенности:Специальный алгоритм - "распределенный интеллект", заключается в совместном анализе сигналов извещателем и контрольной панелью.

Основные характеристики:Встроенный геркон - тестирование извещателя магнитом.
Адаптивность в обработке сигнала, что позволяет исключить ложные срабатывания.
Программирование адреса извещателя при помощи программатора - Аврора-3П.

