Аргус-Спектр Амур-И (ИП 212-118) -  извещатель пожарный дымовой оптико-электронный линейный адресно-аналоговый. Предназначен для обнаружения возгораний в помещениях, имеющих большую протяженность (10–100 м) или большую высоту потолков и передачи сигналов о пожаре и неисправности адресно-аналоговому приемно-контрольному прибору ИСБ "Стрелец-Интеграл" (БСЛ240-И).

Особенности:Алгоритм "Распределенный интеллект": анализ сигналов о пожаре совместно с контрольной панелью;
Автоподстройка чувствительности;
Автокомпенсация запыленности.
Лазерный указатель: визуальный контроль направления луча при юстировке.
Степень защиты оболочки IP 65: полная защита от пыли и потоков воды.

Основные характеристики:дальность действия до 100 м (для дальностей 80 - 100 м необходим дополнительный блок отражателей);
параметры извещателя программируются через ПКУ.
